webpackJsonp([65513920469967],{5716:function(e,t){e.exports={data:{post:{html:"<p>In the excitement yesterday, I forgot to mention that it was our 19th wedding anniversary. Mama and I remembered to each other, and in light of recent blogger weddings I was planning on writing a long recount of September 6, 1983. But now that I've missed it, I think I'll wait until next year. But an Irish pub and a lesbian disco both played a role in the festivities. As did the INS.</p>\n<p><b>Update</b> Thanks for the well wishes, folks! And I did write up an <a href=\"http://www.papascott.de/2002/09/09/1876.php#001876\">account of our wedding day</a> after all.</p>",fields:{title:"Nineteen",date:"07 Sep 2002",url:"https://papascott.de/2002-09-07-nineteen/"}}},pathContext:{slug:"/2002-09-07-nineteen/",prev:{fields:{title:"Fear of America, and of being left out",date:"07 Sep 2002",slug:"/2002-09-07-fear-of-america-and-of-being-left-out/"}},next:{fields:{title:"Week Off",date:"07 Sep 2002",slug:"/2002-09-07-week-off/"}}}}}});
